  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Target Rock National
  Wildlife Refuge outlines Refuge accomplishments during the 1977 calendar year. This
  narrative also covers Amaganset, Conscience Point, Morton, Oyster Bay, Seatuck NWR.
  The report begins with an introduction to the Refuge and information about weather
  conditions, habitat conditions, land acquisition activities, and the system status.
  Construction, maintenance, and wildfires are also described. The wildlife section
  of the report discusses endangered and threatened species, migratory birds, mammals,
  and non-migratory birds. Interpretation and recreation activities are outlined;
  topics include information and interpretation, recreation, and law enforcement.
  Items of interest are attached.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
